import React from 'react';
import logo from './logo.svg';
import './App.css';
import Component from './component'; // Asegúrate de que el nombre del archivo y la ruta coincidan

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* Contenido del header */}
        <h1>Este es mi Header</h1>
        {/* Logo y texto existente */}
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hola Niggas!!
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      {/* Componente adicional */}
      <Component />
    </div>
  );
}

export default App;
